        }
    }

    render() {
        return (
            <div>
                <form className="contact-form">
                    <div className="row">
                        <div className="form-group col-md-6">
                            <input type="text" name="contact-name" className="form-control" id="input_name" placeholder="Tipo de Agua *" value={this.props.water} onChange={this.props.onChangeWater} required/>
                        </div>
                        <div className="form-group col-md-6">
                            <input type="email" name="contact-email" className="form-control" id="input_email" value={this.props.liters} onChange={this.props.onChangeLiters} placeholder="Litros de la Pecera *" required/>
                        </div>
                    </div>
                </form>
                <div className="section-padding"></div>
            </div>
        );
    }
}

export default Mantain;
